import {Service} from './Service'
export function login(data) {
  return Service({
    url: '/user/login/',
    method: 'post',
    data: data
  })
}
export function register(data) {
  return Service({
    url: '/user/regist/ ',
    method: 'post',
    data: data
  })
}
// 账号管理 导入
export function accountUpload(data) {
  return Service({
    url: '/account/upload/',
    method: 'post',
    data: data
  })
}
// 账号管理 导出
export function accountDownload(data) {
  return Service({
    url: '/account/download/',
    method: 'post',
    data: data
  })
}
// 账号管理 查询
export function accountQuery(data) {
  return Service({
    url: '/account/sel/',
    method: 'post',
    data: data
  })
}
// 账号管理 清空
export function accountRemoveall(data) {
  return Service({
    url: '/account/removeall/',
    method: 'post',
    data: data
  })
}

// 管理员 查询
export function taskQuery(data) {
  return Service({
    url: '/content/sel/',
    method: 'post',
    data: data
  })
}
